import React from 'react'
import logo from './logo.svg';
import './App.css';



class App extends React.Component {

  task(value) {
    return <li>{value}</li>
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
        </header>
        <p>{task("sss")}</p>
      </div>
    );
  }
}

export default App;
